wmsx.ROMDatabase = {

    uncompress: function () {
        wmsx.ROMDatabase = JSON.parse(wmsx.Util.uncompressStringBase64ToString(this.data));
        // Throw away the compressed version, will be garbage collected
    },

    empty: function () {
        wmsx.ROMDatabase = { };
    },

    data: ""

};
